import React from 'react';
import './App.css';
import Main from './components/main';
import { Toolbar, Link } from '@material-ui/core';
//import { Link } from 'react-router-dom';




function App() {
  return (
    <div>
      <Toolbar component="nav" variant="dense">

          <Link
            color="inherit"
            noWrap
            key="Text"
            variant="body2"
            href={section.url}
            className={classes.toolbarLink}
          >
            Text
          </Link>
      </Toolbar>

      <Main />
    </div>
  );
}

export default App;
